INSERT INTO `text` (`idTex`, `content`, `idCat`, `approved`) VALUES
(1, 'In modern historiography, ancient Rome is the Roman civilization from the founding of the Italian city of Rome in the 8th century BC to the collapse of the Western Roman Empire in the 5th century AD.', 1, 1),
(2, 'Ancient Greece was a northeastern Mediterranean civilization, existing from the Greek Dark Ages of the 12th?9th centuries BC to the end of classical antiquity (c. 600 AD)', 1, 1),
(3, 'Cylon was an Athenian of the archaic period in Ancient Greece, primarily known for the events of the Cylonian Affair', 1, 1),
(4, 'The Battle of Thermopylae was fought in 480 BC at Thermopylae between the Achaemenid Persian Empire under Xerxes I and an alliance of Greek city-states led by Sparta under Leonidas I.', 1, 1),
(5, 'The Greco-Persian Wars (also often called the Persian Wars) were a series of conflicts between the Achaemenid Empire and Greek city-states that started in 499 BC and lasted until 449 BC.', 1, 1),
(6, 'In 491 BC, Darius sent emissaries to all the Greek city-states, asking for a gift of \'earth and water\' in token of their submission to him. Having had a demonstration of his power the previous year, the majority of the Greek cities duly obliged. In Athens, however, the ambassadors were put on trial and then executed; in Sparta, they were simply thrown down a well. This meant that Sparta was also now effectively at war with Persia.', 1, 1),
(7, 'Lepidoptera or lepidopterans is an order of winged insects which includes butterflies and moths.', 2, 1),
(8, 'A leaf is a principal appendage of the stem of a vascular plant, usually borne laterally above ground and specialized for photosynthesis.', 2, 1),
(9, 'Chlorophyll is any of several related green pigments found in cyanobacteria and in the chloroplasts of algae and plants.', 2, 1),
(10, 'The terms \"mushroom\" and \"toadstool\" go back centuries and were never precisely defined, nor was there consensus on application.', 2, 1),
(11, 'The cat (Felis catus), also referred to as the domestic cat or house cat, is a small domesticated carnivorous mammal. It is the only domesticated species of the family Felidae. Advances in archaeology and genetics have shown that the domestication of the cat occurred in the Near East around 7500 BC.', 2, 1),
(12, 'Taxonomically, the term \"weed\" has no botanical significance, because a plant that is a weed in one context, is not a weed when growing in a situation where it is wanted.', 2, 1),
(13, 'Trade isn\'t about goods. Trade is about information. Goods sit in the warehouse until information moves them. ~ C. J. Cherryh', 3, 1),
(14, 'Ars longa, vita brevis. (Art is long, life is short.) ~ Horace', 3, 1),
(15, 'All the world\'s a stage, And all the men and women merely players: They have their exits and their entrances; And one man in his time plays many parts. ~ William Shakespeare', 3, 1),
(16, 'What light through yonder window breaks? ~ Romeo, Act II, scene ii.', 3, 1);
